DROP DATABASE IF EXISTS ironman;

CREATE DATABASE IF NOT EXISTS ironman;

USE ironman;


CREATE TABLE businessobject (
  id           VARCHAR(40) PRIMARY KEY,
  botype       VARCHAR(250)
);

